CREATE FUNCTION [dbo].[НайтиЛогин]
(
    @Логин NVARCHAR(200)
)
RETURNS BIT
AS
BEGIN
    DECLARE @Результат BIT = 0;
    
    SELECT @Результат = 1
	FROM dbo.ПользователиКлиентов as c
	WHERE c.Логин = @Логин

	if @Результат = 0
		SELECT @Результат = 1
		FROM dbo.ПользователиСотрудников as c
		WHERE c.Логин = @Логин

	RETURN @Результат
END;
