CREATE PROCEDURE [dbo].[ОбновлениеОценкиОбращения]
    @ИдОбращения AS INT,
	@Оценка AS float
AS
BEGIN
	SET NOCOUNT ON;            
    
	UPDATE o SET o.Оценка = @Оценка
	FROM dbo.Обращения as o
	WHERE o.ИдОбращения = @ИдОбращения
END;
GO
