CREATE PROCEDURE [dbo].[ОбновлениеОценкиПриложения]
    @ИдКлиента AS INT,
	@Оценка AS float
AS
BEGIN
	SET NOCOUNT ON;            
    
	if EXISts (SELECT 1 FROM dbo.ОценкиКлиентов AS d WHERE d.ИдКлиента = @ИдКлиента)
		UPDATE c SET c.Оценка = @Оценка
		FROM dbo.ОценкиКлиентов as c
		WHERE c.ИдКлиента = @ИдКлиента
	ELSE 
		INSERT INTO dbo.ОценкиКлиентов (ИдКлиента, Оценка) VALUES(@ИдКлиента, @Оценка)
END;
